code.regionString:
if usePregen
    load task5data.mat
    fprintf('K = %i time steps with sampling intervall Ts = %f sec', K, Ts)
    figure(1); clf; grid on; hold on;
    % show ground truth and measurements
    plot(Xgt(1,:), Xgt(2,:));
    scatter(Z(1, :), Z(2, :));
    title('Data')
    % show turnrate
    figure(2); clf; grid on;
    plot(Xgt(5, :));
    xlabel('time step')
    ylabel('turn rate')
else
    % rng(...) % random seed can be set for repeatability
    % inital state distribution
    x0 = [0, 0, 1, 1, 0]';
    P0 = diag([50, 50, 10, 10, pi/4].^2);
    % model parameters
%   % commented out to be able to run pregen without filling this in
%     qtrue = [...; ...];
%     rtrue = ...;
%     % sampling interval a lenght
%     K = ...;
%     Ts = ...;
    % get data
    [Xgt, Z] = sampleCTtraj(K, Ts, x0, P0, qtrue, rtrue);
    % show ground truth and measurements
    figure(1); clf; grid on; hold on;
    plot(Xgt(1,:), Xgt(2,:));
    scatter(Z(1, :), Z(2, :));
    title('Data')
    % show turnrate
    figure(2); clf; grid on;
    plot(Xgt(5, :));
    xlabel('time step')
    ylabel('turn rate')
end

for k = 3:(K-1)
    % estimate
    [xp, Pp] = ekf.predict(xhat(:, k), Phat(:, :, k), Ts);
    xbar(:, k) = xp;
    Pbar(:, :, k) = Pp;
    % innovate
    %function [vk, Sk] = innovation(obj, z, x, P)
    [vk, Sk] = ekf.innovation(Z(:, k + 1), xp, Pp);
    % update
    %function [xupd, Pupd] = update(obj, z, x, P)
    [xupd, Pupd] = ekf.update(Z(:, k + 1), xp, Pp);
    xhat(:, k + 1) = xupd;
    Phat(:, :, k + 1) = Pupd; 
end

